import React from 'react';
import Filter from "../Filter/filter";
import {Nav,Row,Col} from 'react-bootstrap'
import classes from './navbar.module.css';

const Navbar = ({choice}) => {
    const filter = () => {
        document
            .querySelector(".Filter")
            .classList
            .toggle("hide");
        console.log("filterOption");
    };
    return (
        <Row className='bg-dark p-5'>
            <Col sm={6}>
                <Nav fill variant="tabs" defaultActiveKey="/home">
                    <Nav.Item>
                        <Nav.Link className={classes.Navlink} href="/">Nearest rides</Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Nav.Link className={classes.Navlink} eventKey="/upcoming">Upcoming rides(4)</Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Nav.Link className={classes.Navlink} eventKey="/past">Past rides (3)</Nav.Link>
                    </Nav.Item>
                </Nav>
            </Col>
        </Row>
    );
};

export default Navbar;
